import React from 'react';


function Display(){
  return (
    <div>
    <h1>Timer 1 </h1>
      <div className="time">
        {seconds/10}s
      </div>
      <div className="row">
        <button className={` button-primary stopwatch-btn-gre button -${isActive ? 'active' : 'inactive'}`} onClick={toggle}>
          {isActive ? 'Stop' : 'Start'}
        </button>
        <button className="stopwatch-btn-gre button" onClick={reset}>
          Reset
        </button>
      </div>
    </div>
  );
};

export default Display;
